def generate_random_dag():
    """
    Based on http://stackoverflow.com/questions/12790337/generating-a-random-dag
    """
    edge_probability = randint(10,30)
    ranks = randint(3, 10)
    graph = defaultdict(list)
    node_max = 0

    for r in xrange(ranks):
        new_nodes = randint(2, 20)

        for old_node in xrange(node_max):
            for n in xrange(new_nodes):
                node = node_max + n
                if randint(0,100) < edge_probability:
                    graph[old_node].append(node)
                else:
                    graph[old_node]

        node_max += new_nodes

    for n in xrange(new_nodes):
        graph[node_max - n - 1] = []

    return graph


class TestMissing(EnhancedTestCase):
    """Test for vsc.utils.missing module."""

    @with_checker([int])
    def test_nub_length(self, list_of_ints):
        nubbed = nub(list_of_ints)
        self.assertTrue(len(list_of_ints) >= len(nubbed))

    @with_checker([int])
    def test_nub_membership(self, list_of_ints):
        nubbed = nub(list_of_ints)
        for x in list_of_ints:
            self.assertTrue(x in nubbed)

    @with_checker([int])
    def test_nub_order(self, list_of_ints):
        nubbed = nub(2 * list_of_ints)
        for (x, y) in [(x_, y_) for x_ in list_of_ints for y_ in list_of_ints]:
            self.assertTrue((list_of_ints.index(x) <= list_of_ints.index(y)) == (nubbed.index(x) <= nubbed.index(y)))

    def test_tryorfail_no_sleep(self):
        """test for a retry that succeeds."""

        raise_boundary = 2

        @TryOrFail(3, (Exception,), 0)
        def f(i):
            if i < raise_boundary:
                raise Exception
            else:
                return i

        for n in xrange(0, 2 * raise_boundary):
            try:
                v = f(n)
                self.assertFalse(n < raise_boundary)
                self.assertTrue(v == n)
            except:
                self.assertTrue(n < raise_boundary)

    def test_frozendictknownkeys(self):
        """Tests for FrozenDictKnownKeys."""
        fdkk = FrozenDictKnownKeys()

        # abstract class has empty set of known keys, so can be initialized with a dict
        self.assertErrorRegex(Exception, 'Encountered unknown keys', FrozenDictKnownKeys, {'foo': 'bar'})

        class TestFrozenDictKnownKeys(FrozenDictKnownKeys):
            """Inner test class derived from FrozenDictKnownKeys."""
            KNOWN_KEYS = ['foo', 'foo2']

        tfdkk = TestFrozenDictKnownKeys({'foo': 'bar'})
        self.assertEqual(tfdkk['foo'], 'bar')

        # check different error message for missing known and unknown keys
        self.assertErrorRegex(Exception, "foo2", tfdkk.__getitem__, 'foo2')
        self.assertErrorRegex(Exception, "unknown key 'foo3', known keys: .*", tfdkk.__getitem__, 'foo3')

        # no (direct) way of adjusting dictionary
        self.assertErrorRegex(AttributeError, ".*has no attribute.*", lambda x: tfdkk.__setitem__(x), ('foo2', 'bar2'))
        self.assertErrorRegex(AttributeError, ".*has no attribute.*", lambda x: tfdkk.update(x), {'foo2': 'bar2'})
        # unknown keys are not allowed
        self.assertErrorRegex(Exception, 'Encountered unknown keys', TestFrozenDictKnownKeys, {'foo3': 'bar3'})

        # test ignoring of unknown keys
        tfdkk = TestFrozenDictKnownKeys({'foo': 'bar', 'foo2': 'bar2', 'foo3': 'bar3'}, ignore_unknown_keys=True)
        self.assertEqual(sorted(tfdkk.keys()), ['foo', 'foo2'])

    def test_fixed_topological_sort(self):
        """
        test for a topologicalsort on a fixed set of DAGs
        """
        for g in DAG_TEST_SET:
            visited = set()
            sorting = list(topological_sort(g))
            for node in reversed(sorting):
                adjacent = set(g[node])
                self.assertTrue(adjacent.isdisjoint(visited))

            self.assertTrue(len(sorting) == len(g.keys()))


    def test_random_topological_sort(self):
        """
        test for a topological sort.

        the key invariant should be that if a appears before b in the resulting sort, there is no way to reach
        b from a in the DAG.
        """
        for i in xrange(10):
            g = generate_random_dag()
            sorting = list(topological_sort(g))
            visited = set()
            for node in reversed(sorting):
                adjacent = set(g[node])
                self.assertTrue(adjacent.isdisjoint(visited))

            self.assertTrue(len(sorting) == len(g.keys()))


